window.bookSummaryJSON = "<p><b>Top 30 in the entire Kindle store.</b></p> <p>I'm nothing like my father. My brothers don't realize I'm a thousand times worse. Grief fuels my every action. Vengeance burns through my veins, dictating every decision I make. I'll shatter allegiances to please him.</p> <p>I'm nothing like my father. You don't realize that I'm a thousand times worse. I have Savannah at my side—a ruthless partner capable of raining hellfire upon her enemies—until she realizes I lied to her....</p> <p>My house of cards is tumbling down, and I've underestimated my queen.</p> <p><i>Filthy King </i>is the seventh book in the Five Points' Mob Collection and can be listened to as a stand-alone.</p> <p><i>Contains a series cliff-hanger.</i></p>"; 
